import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import {CustomerComponent} from './app.component';

@NgModule({
  declarations: [
    CostumerComponent
  ],
  imports: [
    BrowserModule,
  ],
  providers: [],
  bootstrap: [CostumerComponent]
})
export class AppModule { }
